import React from 'react';
import '../../css/UserGroups.css';

const UserGroups = () => {
  const groups = [
    { name: 'Men', imageUrl: 'path_to_men_image.jpg' },
    { name: 'Women', imageUrl: 'path_to_women_image.jpg' },
    { name: 'Kid', imageUrl: 'path_to_kid_image.jpg' },
  ];

  return (
    <div className="user-groups">
      {groups.map((group, index) => (
        <div className="group" key={index}>
          <img
            src={group.imageUrl}
            alt={`${group.name} Category`}
            className="group-image"
          />
          <h2>{group.name}</h2>
        </div>
      ))}
    </div>
  );
};

export default UserGroups;
